
using System;
using System.IO;
using System.Text;
using System.Windows.Forms;

namespace WinMergeExtensionInstaller
{
    class Program
    {
        //todo think about all const values
        const string DirName = @"C:\WinMergeExtension\";
        const string FilePrName = "PrepareWinMerge.bat";
        const string FilePrDebugModeName = "PrepareWinMergeDebugMode.bat";
        const string FileStName = "StartWinMerge.bat";
        const string FileSettingsName = "Settings.txt";
        const string FileExtName = "WinMergeExtension.exe";
        const string FileWpfExtName = "WpfChooser.exe";
        const string PrCode = "start " + DirName + FileExtName + " %1";
        const string StCode = "start WinMergeU.exe /maximize %1 %2";
        const string SentToPath = @"C:\Users\{0}\AppData\Roaming\Microsoft\Windows\SendTo\";
        const char SplitterBytes = ',';
        const char SplitterPath = '\\';
        const string BranchParName = "BrPath";
        const string UpdatesCheckName = "CheckUpdates";
        const string AutoUpdateName = "AutoUpdate";
        const string DefaultBranchParName = BranchParName + "=C:\\Sources\\";
        const string DefaultUpdatePathName = @"UpdateUrl=\\pcbbenet-1\Tools\";
        const string DefaultUpdateFileName = @"UpdateFile=WinMergeExtensionInstaller.exe";
        const string DefaultUpdatesCheckName = UpdatesCheckName + "=true";
        const string DefaultAutoUpdateName = AutoUpdateName + "=false";



        [STAThread]
        static void Main(string[] args)
        {
            bool firstInstall = !Directory.Exists(DirName);

            if (firstInstall)
                Directory.CreateDirectory(DirName);

            StreamWriter outPrFile = new StreamWriter(DirName + FilePrName);
            outPrFile.WriteLine(PrCode);
            outPrFile.Close();

            outPrFile = new StreamWriter(DirName + FilePrDebugModeName);
            outPrFile.WriteLine(PrCode + " true");
            outPrFile.Close();

            outPrFile = new StreamWriter(DirName + FileStName);
            outPrFile.WriteLine(StCode);
            outPrFile.Close();

            string settingFile = GetSettingsTemplate(firstInstall);
            outPrFile = new StreamWriter(DirName + FileSettingsName);
            outPrFile.WriteLine(settingFile);
            outPrFile.Close();

            File.Copy(DirName + FilePrName,
                string.Format(SentToPath, Environment.UserName) + FilePrName, true);
            File.Copy(DirName + FilePrDebugModeName,
                string.Format(SentToPath, Environment.UserName) + FilePrDebugModeName, true);

            File.WriteAllBytes(DirName + FileExtName, GetWinMergeExtentionData());
            File.WriteAllBytes(DirName + FileWpfExtName, GetWpfExtentionData());

            Environment.Exit(0);
        }

        private static string GetSettingsTemplate(bool firstInstall)
        {
            StringBuilder res = new StringBuilder();

            res.AppendLine(new string('*', 27));
            res.AppendLine("WinMergeExtension Settings");
            res.AppendLine(new string('*', 27));
            res.AppendLine("** Here you can set default location of your branches");

            if (firstInstall)
            {
                using (FolderBrowserDialog fbd = new FolderBrowserDialog())
                {
                    fbd.Description = "Please select Source folder for set up your settings";
                    fbd.ShowNewFolderButton = false;

                    if (fbd.ShowDialog() == DialogResult.OK)
                        res.AppendLine(BranchParName + "=" + fbd.SelectedPath + SplitterPath);
                    else
                        res.AppendLine(DefaultBranchParName);
                }
                res.AppendLine(new string('*', 27));
                res.AppendLine(DefaultUpdatesCheckName);
                res.AppendLine(new string('*', 27));
                res.AppendLine(DefaultAutoUpdateName);
                res.AppendLine(new string('*', 27));
            }
            else
            {
                try
                {
                    res.AppendLine(GetOldSettings(BranchParName) ?? DefaultBranchParName);
                    res.AppendLine(new string('*', 27));
                    res.AppendLine(GetOldSettings(UpdatesCheckName) ?? DefaultUpdatesCheckName);
                    res.AppendLine(new string('*', 27));
                    res.AppendLine(GetOldSettings(AutoUpdateName) ?? DefaultAutoUpdateName);
                    res.AppendLine(new string('*', 27));
                }
                catch
                {
                    GetSettingsTemplate(true);
                }
            }
            res.AppendLine(DefaultUpdatePathName);
            res.AppendLine(new string('*', 27));
            res.AppendLine(DefaultUpdateFileName);
            res.AppendLine(new string('*', 27));

            return res.ToString();
        }

        private static string GetOldSettings(string settingName)//todo dublicated function GetSettings need to remove it later
        {
            string sRes = null;
            StreamReader settings = null;

            try
            {
                settings = new StreamReader(DirName + FileSettingsName);

                do
                {
                    string line = settings.ReadLine();

                    if (line != null && line.StartsWith(settingName))
                        sRes = line;
                } while (!settings.EndOfStream);
            }
            finally
            {
                settings.Dispose();
            }

            return sRes;
        }

